(1, '1', '#EMPRESA#\nCNPJ: #CNPJ#\nEndereço: #ENDERECO#\nContato: #CONTATO#\n\n==================================\n\nOlá *#NOME#*,\n\nPassando para informar que em *5* dias vence sua mensalidade no valor de:\n*R$: #VALOR#*\n\nPara realizar o pagamento agora basta clicar no link abaixo:\nhttps://financeiro.gestorproplw.com#LINK#\n\nSe preferir estou te enviando nossa chave pix *Copia e Cola* logo abaixo.\n\nBasta copiar a chave e abrir seu aplicativo para realizar o pagamento.', '1', '1', '11:30'),
(2, '1', 'Olá #NOME#,\n\nPassamos para informar que hoje vence sua mensalidade no valor de R$: #VALOR#.\n\nCopie a chave abaixo e no seu aplicativo na opção PIX procura a opção Pagar com chave Copia e Cola.\n\n#COPIAECOLA#\n\nVocê também poderá pagar clicando no link abaixo:\n\nhttps://financeiro.gestorproplw.com#LINK#\n\n*Caso já tenha efetuado o pagamento favor desconsiderar esta cobrança.*\n\nEsta é uma mensagem automática e não precisa ser respondida.', '2', '1', '11:30'),
(3, '1', 'Olá #NOME#,\n\nPassamos para informar que hoje vence sua mensalidade no valor de R$: #VALOR#.\n\nPara realizar o pagamento basta clicar no link abaixo:\n\nhttps://financeiro.gestorproplw.com#LINK#\n\nCaso já tenha efetuado o pagamento por favor desconsiderar.\n\nEsta é uma mensagem automática e não precisa ser respondida.', '3', '1', '11:30'),
(4, '1', '#EMPRESA#\nCNPJ: #CNPJ#\nEndereço: #ENDERECO#\nContato: #CONTATO#\n\n=============================\n\nOlá *#NOME#*,\n\nPassando para informar que sua mensalidade no valor de:\n*R$: #VALOR#* encontra-se vencida desde o dia #VENCIMENTO#.\n\nPara realizar o pagamento agora basta clicar no link abaixo:\n\nhttps://financeiro.gestorproplw.com#LINK#\n\nSe preferir estou te enviando nossa chave pix *Copia e Cola* logo abaixo.\n\nBasta copiar a chave e abrir seu aplicativo para realizar o pagamento.', '4', '1', '11:30'),
(5, '1', '#EMPRESA#\nCNPJ: #CNPJ#\nEndereço: #ENDERECO#\nContato: #CONTATO#\n\n==================================\n*RECIBO DE PAGAMENTO*\n==================================\nCliente: *#NOME#*\nData de Vencimento: #VENCIMENTO#\nData de Pagamento: #DATAPAGAMENTO#\nValor: R$: #VALOR#\n==================================\n\nEsta é uma mensagem automática e não precisa ser respondida.', '5', '1', '11:30'),
(6, '1', '#EMPRESA#\nCNPJ: #CNPJ#\nEndereço: #ENDERECO#\nContato: #CONTATO#\n\n=============================\n\nOlá *#NOME#*,\n\nPassando para informar que sua mensalidade no valor de:\n*R$: #VALOR#* já está disponível para pagamento.\n\nPara realizar o pagamento agora basta clicar no link abaixo:\n\nhttps://financeiro.gestorproplw.com#LINK#\n\nSe preferir estou te enviando nossa chave pix *Copia e Cola* logo abaixo.\n\nBasta copiar a chave e abrir seu aplicativo para realizar o pagamento.', '6', '1', '11:30'),
